INSERT INTO "equipe" ("id", "nom", "prenom", "description", "img") VALUES
(7,	'Le Joly',	'Thomas',	'Mon nom est Thomas Le Joly. Passionné depuis longtemps par le monde de la radio, j’ai souhaité rejoindre Radio Guy Chauvet pour participer à ce projet qui, selon moi, peut permettre aux lycéens d’apprendre et de se divertir de manière originale au sein de l’établissement, qu’ils soient auditeurs ou participants. Bref, bon surf ^_^ .',	'Le_Joly_Thomas.png'),
