(3,	'Fontaine',	'Emeraude',	'Je m’appelle Émeraude, je suis en terminale, je suis un peu barge et toujours à la recherche de sujet intéressant à développer, c’est pour ça que j’ai décidé de rejoindre la webradio.',	'Fontaine_Emeraude.png'),
(2,	'Devaux',	'Faust',	'Bonjour je suis Faust Devaux et je suis en terminale. Je participe au journal radio et au magazine cinéma de la Radio Guy Chauvet. J''ai décidé de faire partie de la web radio pour apprendre à mieux m''exprimer et comprendre le métier de journaliste.',	'Devaux_Faust.png'),
(5,	'Godichaud',	'William',	'Hey, je suis William, un passionné d''histoire qui adore la Web radio. Je tiens l''émission Histoire de poche. Retrouvez-moi vite !',	'Godichaud_William.png'),
(6,	'Klinzing',	'Gaëtan',	'Bonjour, je m’appelle Gaëtan Klinzing, j’ai 15 ans. J’aime beaucoup le sport, c’est pour cela que je suis dans la rubrique sport en tant que Writer.',	'Klinzing_Gaëtan.png'),
(8,	'Meyer',	'Luce',	'Je m''appelle Luce et je suis en première. Je participe à  l''émission "histoire de poche". Je suis là parce j''aime ça et on peut découvrir de nouvelles choses :)',	'Meyer_Luce.png'),
(9,	'Rochoux',	'Quentin',	'Je m''appelle Quentin Rochoux, je suis passionné d''actualités en particulier de sport et la politique. Je suis rédacteur en chef du journal et je compte devenir journaliste.',	'Rochoux_Quentin.png'),
